import { Link } from 'react-router-dom';
import { useState } from 'react';
import {useMutation} from 'react-query'
import { API} from '../config/api'
import { Modal, Form, Button } from 'react-bootstrap';
import Swal from 'sweetalert2'

function ModalRegister() {

    const [form, setForm] = useState({
        fullName: '',
        username: '',
        email: '',
        password: '',
        gender: 'l',
        phone: '',
        address: '',
    });
    const { fullName, username, email, password, gender, phone, address } = form;
    const handleChange = (e) => {
        setForm({
            ...form,
            [e.target.name]: e.target.value,
        });
    };

    const handleSubmit = useMutation(async (e) => {
        try {
            e.preventDefault();

            const response = await API.post('/register', form);
            Swal.fire({
                title: 'Success!',
                text: 'Registrasi berhasil',
                icon: 'success',
                confirmButtonText: 'Kembali'
            })
            setForm({
                email: '',
                password: '',
                name: '',
            });
            handleClose()
        } catch (error) {
            Swal.fire({
                title: 'Error!',
                text: 'Registrasi gagal',
                icon: 'error',
                confirmButtonText: 'Kembali'
            })
            console.log("register failed : ", error);
        }
    });

    const [show, setShow] = useState(false);
    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);

    return (
        <>
            <Link onClick={handleShow} className='nav-link'>
                <span className='nav-text-register'>Sign up</span>
            </Link>

            <Modal show={show} onHide={handleClose}>
                <Modal.Body className='p-4'>
                    <h4 className='nav-text-bold my-3 text-center'>Sign un</h4>
                    <Form onSubmit={(e) => handleSubmit.mutate(e)}>
                        <Form.Group className="mb-3" controlId="formBasicFullName">
                            <Form.Label className='nav-text-bold'>Full Name</Form.Label>
                            <Form.Control name="fullName" type="text" value={fullName} onChange={handleChange}/>
                        </Form.Group>
                        <Form.Group className="mb-3" controlId="formBasicUsername">
                            <Form.Label className='nav-text-bold'>Username</Form.Label>
                            <Form.Control name="username" type="text" value={username} onChange={handleChange}/>
                        </Form.Group>
                        <Form.Group className="mb-3" controlId="formBasicEmail">
                            <Form.Label className='nav-text-bold'>Email</Form.Label>
                            <Form.Control name="email" type="email" value={email} onChange={handleChange}/>
                        </Form.Group>
                        <Form.Group className="mb-3" controlId="formBasicPassword">
                            <Form.Label className='nav-text-bold'>Password</Form.Label>
                            <Form.Control name="password" type="password" value={password} onChange={handleChange}/>
                        </Form.Group>
                        <Form.Group className="mb-3" controlId='formBasicGender'>
                            <Form.Label className='nav-text-bold'>Gender</Form.Label>
                            <Form.Select name="gender" value={gender} onChange={handleChange}>
                                <option value="l">Laki-Laki</option>
                                <option value="p">Perempuan</option>
                            </Form.Select>
                        </Form.Group>
                        <Form.Group className="mb-3" controlId='formBasicPhone'>
                            <Form.Label className='nav-text-bold'>Phone</Form.Label>
                            <Form.Control name="phone" type='number' value={phone} onChange={handleChange} />
                        </Form.Group>
                        <Form.Group className="mb-3" controlId='formBasicAddress'>
                            <Form.Label className='nav-text-bold'>Address</Form.Label>
                            <Form.Control
                                name="address"
                                as="textarea"
                                style={{ height: '100px' }}
                                value={address}
                                onChange={handleChange}
                            />
                        </Form.Group>
                        <Button variant="primary" type="submit" className='all-btn-submit'>
                            Sign up
                        </Button>
                    </Form>
                </Modal.Body>
            </Modal >
        </>
    )
}

export default ModalRegister;
